    return (
        <div className='expense-item'>
            <div>March 28th 2021</div>
            <div className='expense-item__desc'>
                Car Insurance
            </div>
            <div className='expense-item__amt'>$294.67</div>
        </div>
    );
}

export default ExpenseItem;
